import React, { Component } from 'react'
import Button from "@material-ui/core/Button";
import { connect } from "react-redux";
import TextField from "@material-ui/core/TextField";
import { deleteLocation,EditLocation } from '../actions'
import _ from "lodash";

class ShowLocation extends Component {
    render() {
        return (
            <tr key={this.props.item.id} >
            <td><TextField
              label="Latitude"
              name="latitude"
              placeholder="latitude"
              size="small"
              pattern="[+-]?\d+(?:[.,]\d+)?"
              defaultValue={this.props.item.latitude}
              required
            /></td>
            <td>{this.props.item.longitude}</td>
            <td>
              <Button
                size="small"
                variant="contained"
                color="primary"
                onClick={() => this.props.EditLocation(this.props.item.id)}>Edit</Button>
            </td>
            <td>
              <Button
                size="small"
                variant="contained"
                color="secondary"
                onClick={() => this.props.deleteLocation(this.props.item.id)}>Delete</Button>
            </td>
          </tr>
        )
    }
}
export default connect(null,{deleteLocation,EditLocation})(ShowLocation);
